import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

const AboutUsBox = {
    display: 'flex',
    flexDirection: 'column',
    alignItems : 'center',
    mt: '200px'
}

function Profile() {
  return (
    <>
      <Box sx={AboutUsBox}>
        <Typography>
          About us 
        </Typography>
        <Typography sx={{width: '400px', textAlign: 'center', fontWeight: 'bold', fontSize: '25px'}}>
         We're on a mission to make building UIs more accessible
        </Typography>
        <Typography sx={{width: '400px', textAlign: 'center', fontSize: '15px'}}>
          Our mission is to empower anyone to build UIs, faster. We're reducing the
          entry barrier, making design skills accessible.
        </Typography>
      </Box>
    </>
  );
}

export default Profile;
